Avontuur / Drama

110 minuten
geregisseerd door Gina Prince-Bythewood
met Queen Latifah, Dakota Fanning en Jennifer Hudson

In het South-Carolina van 1964, lopen Lily Owens en haar enige vriendin Rosaleen Daise weg van huis om te ontsnappen aan de ruwe opvoeding en de moeilijke relatie met haar vader. Lily vlucht ook omdat zij op zoek wil gaan naar de geheimen en mysteries van haar overleden moeder. Onderweg ontmoeten zij drie zusters die imkers zijn en die het koppel met een warm hart ontvangen in hun huis. Daar zullen zij het geheim van de moeder van Lily waarschijnlijk kunnen onthullen.


